              "$alert: red;\n$green: #52c41a;\n$background: white;\n$border: #e5e5e5;\n\n.preview {\n  display: flex;\n  flex-direction: column;\n  justify-content: flex-start;\n  margin: 10px auto;\n  margin-top: 26px;\n  padding: 15px 15px 24px 19px;\n  width: 941px;\n  min-height: 140px;\n  border-radius: 7px;\n  box-shadow: 0px 4px 12px rgba(0, 0, 0, 0.15);\n  background-color: white;\n}\n.preview__header {\n  display: flex;\n  flex-direction: row;\n  justify-content: space-between;\n}\n.preview__short-desc {\n  display: flex;\n  flex-direction: column;\n  width: 75%;\n}\n.preview__user-info {\n  display: flex;\n  justify-content: flex-end;\n  min-width: 17%;\n}\n.preview__name {\n  margin-right: 7px;\n}\n.preview__user-info img {\n  width: 46px;\n  height: 46px;\n  object-position: center;\n  object-fit: cover;\n  border-radius: 50%;\n}\n.preview__user-info span {\n  display: block;\n}\n.preview__title {\n  display: flex;\n  flex-wrap: nowrap;\n  font-family: Inter;\n  font-weight: 400;\n  font-style: normal;\n  font-size: 20px;\n  line-height: 28px;\n  color: #1890ff;\n}\n.preview__title span:hover {\n  cursor: pointer;\n}\n.preview__description {\n  vertical-align: baseline;\n  font-family: Inter;\n  font-weight: 400;\n  font-style: normal;\n  font-size: 12px;\n  line-height: 24px;\n  color: rgba(0, 0, 0, 0.75);\n  overflow: hidden;\n  margin-top: 8px;\n  margin-bottom: 0;\n  display: -webkit-box;\n  -webkit-line-clamp: 2;\n  -webkit-box-orient: vertical;\n}\n.preview__body {\n  padding: 15px;\n  min-height: 90px;\n  height: auto;\n  text-overflow: ellipsis;\n  overflow: hidden;\n}\n.preview__tags {\n  font-size: 12px;\n  line-height: 12px;\n  border-radius: 3px;\n  border: 1px solid rgb(146, 120, 120);\n  padding-left: 3px;\n  padding-right: 3px;\n  margin-right: 2px;\n  outline: none;\n}\n.preview__tags:hover {\n  cursor: pointer;\n}\n.preview__description-wrapper {\n  display: flex;\n  flex-wrap: nowrap;\n  justify-content: space-between;\n}\n.button-wrapper {\n  display: flex;\n  margin-top: 20px;\n  margin-bottom: 15px;\n}\n.btn {\n  height: 32px;\n  width: 73px;\n  box-sizing: border-box;\n  border-radius: 5px;\n  cursor: pointer;\n  outline: none;\n  background-color: inherit;\n  font-family: inherit;\n  font-style: normal;\n  font-weight: 400;\n  font-size: 16px;\n  line-height: 24px;\n  margin: 0 0 0 14px;\n}\n.btn-del {\n  border: 1px solid $alert;\n  color: $alert;\n  background-color: $background;\n}\n.btn-edit {\n  border: 1px solid $green;\n  color: $green;\n}\n.btn-primary {\n  color: $alert !important;\n  background-color: $background !important;\n  border: 1px solid $alert !important;\n  height: 32px;\n  width: 73px;\n  box-sizing: border-box !important;\n  border-radius: 5px;\n  cursor: pointer;\n  outline: none !important;\n  padding: 0px !important;\n}\n.btn-primary:focus {\n  box-shadow: none !important;\n}\n.modal {\n  position: relative;\n  display: flex;\n  flex-direction: column;\n  justify-content: space-between;\n  position: absolute;\n  top: 0px;\n  right: -180px;\n  width: 175px;\n  height: 86px;\n  border: 2px solid $border;\n  background-color: $background;\n  border-radius: 4px;\n}\n.modal-wrapper {\n  position: relative;\n}\n.hidden {\n  display: none;\n}\n.btn-confirm {\n  height: 23px;\n  width: 38px;\n  border: 1px solid $border;\n  border-radius: 3px;\n}\n.btn-box {\n  display: flex;\n  justify-content: flex-end;\n  margin-bottom: 8px;\n  margin-right: 8px;\n}\n.delete__title {\n  display: inline-block;\n  margin-top: 7px;\n  text-align: center;\n}\n.delete__arrow {\n  position: absolute;\n  width: 14px;\n  height: 14px;\n  transform: translateX(-7px) translateY(2px) rotate(45deg);\n  background-color: $background;\n  border-left: 2px solid $border;\n  border-bottom: 2px solid $border;\n}\n",
